import img from './img/grs.jpg';
import img1 from './img/grs1.jpg';
import img2 from './img/grs2.jpg';

export const grass = [
    {
        id:1,
        name: 'grass1',
        speed: "14",
        img: {img}
    },
    {
        id:2,
        name: 'grass2',
        speed: "20",
        img: {img1}
    },
    {
        id:3,
        name: 'grass3',
        speed: "25",
        img: {img2}
    },
    {
        id:4,
        name: 'grass4',
        speed: "10"
    },
    {
        id:5,
        name: 'grass5',
        speed: "16"
    }
]
